resource/Integrated.html.body:
集成SDK
Tuya Smart Camera SDK依赖于涂鸦全屋智能 APP SDK，在接入涂鸦Tuya Smart Camera SDK之前，您务必先了解一下涂鸦全屋智能 APP SDK。
一、创建工程
在Android Studio中建立你的工程。
二、build.gradle配置

在工程根目录的build.gradle 文件里添加如下配置
     buildscript {

     repositories {
         ...
         maven {
             url 'https://maven-other.tuya.com/repository/maven-releases/'
         }
         maven {
             url 'https://maven-other.tuya.com/repository/maven-snapshots/'
         }
     }
     dependencies {
         classpath 'com.android.tools.build:gradle:3.1.4'

         // NOTE: Do not place your application dependencies here; they belong
         // in the individual module build.gradle files
     }
 }

 allprojects {
     repositories {
         ...
         maven {
             url 'https://maven-other.tuya.com/repository/maven-releases/'
         }
         maven {
             url 'https://maven-other.tuya.com/repository/maven-snapshots/'
         }
     }
 }


app目录下的build.gradle配置：


defaultConfig {
    ndk {
        abiFilters "armeabi-v7a","arm64-v8a"
    }
 }
    dependencies {
        implementation fileTree(dir: 'libs', include: ['*.jar', '*.aar'])
        implementation 'com.alibaba:fastjson:1.1.67.android'
        implementation 'com.squareup.okhttp3:okhttp-urlconnection:3.12.3'
        implementation 'org.eclipse.paho:org.eclipse.paho.client.mqttv3:1.2.0'

        // required tuya home sdk
        implementation 'com.tuya.smart:tuyasmart:3.12.4'

        // tuya camera module
        implementation 'com.tuya.smart:tuyasmart-ipc-camera-middleware:3.14.3r133'
        implementation 'com.tuya.smart:tuyasmart-ipc-camera-v2:3.14.4r134'
        implementation 'com.tuya.smart:tuyasmart-ipc-camera-utils:3.13.0r128'
        implementation 'com.tuya.smart:tuyasmart-ipc-camera-message:3.13.0r128'
        implementation 'com.tuya.smart:tuyasmart-ipc-devicecontrol:3.14.3r133'

    }

repositories {
    mavenLocal()
    jcenter()
    google()
}


【注意事项】 涂鸦智能摄像机sdk默认支持armeabi-v7a,arm64-v8a

三、AndroidManifest.xml设置
在AndroidManifest.xml文件里配置appkey和appSecret，在配置相应的权限等















四、混淆配置
在proguard-rules.pro文件配置相应混淆配置
#fastJson
-keep class com.alibaba.fastjson.**{*;}
-dontwarn com.alibaba.fastjson.**

#mqtt
-keep class org.eclipse.paho.client.mqttv3.** { *; }
-dontwarn org.eclipse.paho.client.mqttv3.**

#tutk
-keep class com.tutk.**{*;}
-dontwarn com.tutk.**

-keep class com.squareup.okhttp.** { *; }
-keep interface com.squareup.okhttp.** { *; }
-dontwarn com.squareup.okhttp.**

-keep class okio.** { *; }
-dontwarn okio.**

-keep class com.tuya.**{*;}
-dontwarn com.tuya.**
-keep class com.tuyasmart.**{*;}
-dontwarn com.tuyasmart.**

resource/wifi_config.html.body:
设备配网
描述
涂鸦 IPC 摄像机主要支持以下配网模式：

快连模式(EZ 模式)
热点模式(AP模式)
二维码模式(Qrcode 模式)


二维码模式配网比较简单，建议使用二维码配网，如果设备扫描不了二维码，再尝试快连模式。

快连模式和热点模式这两种配网方式和涂鸦其他设备的配网方式是一样的可以查看涂鸦全屋智能SDK文档配网, 这里重点讲解一下Qrcode的配网文档。
使用方法
获取当前的Wifi SSID
WiFiUtil.getCurrentSSID()

获取配网Token
Token的有效期为10分钟，且配置成功后就会失效（再次配网需要重新获取）,获取方法如下：
void getActivatorToken(final long homeId, final ITuyaActivatorGetToken activatorGetToken);

参数说明



参数
说明




homeid
家庭id


ITuyaActivatorGetToken
获取token的回调



示例代码
TuyaHomeSdk.getActivatorInstance().getActivatorToken (homeid, new ITuyaActivatorGetToken() {
            @Override
            public void onSuccess(String token) {
                //获取token成功
            }

            @Override
            public void onFailure(String s, String s1) {
                //获取token失败
            }
        })

TuyaCameraActivatorBuilder
通过创建TuyaCameraActivatorBuilder对象来存储二维码url信息，及接口回调。方法如下：
TuyaCameraActivatorBuilder builder = new TuyaCameraActivatorBuilder()
    .setToken(token)
    .setPassword(password) //传入wifi的password
    .setSsid(ssid)
    .setListener(listener); //传入ITuyaSmartCameraActivatorListener 监听对象

参数说明



参数
说明




token
active token


password
wifi的password


ssid
wifi的ssid


ITuyaSmartCameraActivatorListener
回调接口



ITuyaCameraDevActivator
配网接口实现
ITuyaCameraDevActivator mTuyaActivator = TuyaHomeSdk.getActivatorInstance().newCameraDevActivator(builder);

调用二维码接口获取二维码url信息
mTuyaActivator.createQRCode();

开始配网
使用上面生成的url生成二维码，确定设备处于配网状态，将生成的二维码对准摄像头，摄像头设备捕捉到二维码信息后会发出提示音或者灯光变化。此时通过以下接口开始监听配网结果。方法如下：
//开始配置
mTuyaActivator.start();

停止配网
方法如下：
//停止配置
mTuyaActivator.stop();

配网结果回调
配网结果通过ITuyaSmartCameraActivatorListener 配网回调接口，方法如下：
//回调接口
ITuyaSmartCameraActivatorListener() {

    /**
     * 二维码生成成功
     *
     * @param qrcodeUrl 二维码URL
     */
    void onQRCodeSuccess(String qrcodeUrl);
    /**
     * 错误信息
     *
     * @param errorCode 错误码
     * @param errorMsg  错误信息
     */
    void onError(String errorCode, String errorMsg);
    /**
     * 激活成功
     *
     * @param devResp 设备ID
     */
    void onActiveSuccess(DeviceBean devResp);
};

方法说明



方法
说明




onQRCodeSuccess
生成二维码URL成功回调，回调参数即为二维码url地址


onError
错误信息


onActiveSuccess
激活成功



回调销毁
//回调销毁
mTuyaActivator.onDestroy();

二维码配网参考示例代码
//初始化回调接口
ITuyaSmartCameraActivatorListener mListener = new ITuyaSmartCameraActivatorListener() {
    /**
     * 二维码生成成功
     *
     * @param qrcodeUrl 二维码URL
     */
    public void onQRCodeSuccess(String qrcodeUrl){
        //使用url生成二维码
    }
    /**
     * 错误信息
     *
     * @param errorCode 错误码
     * @param errorMsg  错误信息
     */
    public void onError(String errorCode, String errorMsg){
        //配网失败的原因及错误列表，具体参考AP、EZ配网
    }
    /**
     * 激活成功
     *
     * @param devResp 设备ID
     */
    public void onActiveSuccess(DeviceBean devResp){
        //配网成功后续操作

    }
};
TuyaCameraActivatorBuilder builder = new TuyaCameraActivatorBuilder()
    .setToken(token)
    .setPassword(password) //传入wifi的password
    .setSsid(ssid)
    .setListener(listener); //传入ITuyaSmartCameraActivatorListener 监听对象

ITuyaCameraDevActivator mTuyaActivator =    TuyaHomeSdk.getActivatorInstance().newCameraDevActivator(builder);
//生成二维码url
mTuyaActivator.createQRCode();
//开始配置
mTuyaActivator.start();
//停止配置
mTuyaActivator.stop();
//回调销毁
mTuyaActivator.onDestroy();

