DpBasicIndicator.ID
boolean
True： turn on indicator under normal state                                 False: turn off indicator under normal state
Status indicator
Turn on/off device indicator under normal state: avoid light pollution at night. Indicator needs to be turned on during wifi configuration process or device is abnormal.


DpBasicFlip.ID
boolean
True: flip               False: normal status
Screen flip
Turn on/off screen vertical flip: adjust screen direction in the case when the device is upside down.


DpBasicOSD.ID
boolean
True: OSD appears         False: OSD disappears
Time watermark
Turn on/off time watermark in live view mode


