消息推送
简介
Tuya Smart Camera Android SDK消息推送使用的是涂鸦智能全屋SDK的消息推送配置和接收，具体请参阅
按门铃接收推送消息
当按下设备门铃时，设备端会推送消息至App。推送目前的信息:
